import React, { Component } from 'react';



class Page3 extends Component {
    handleScroll=()=>{
        window.scroll({top:0,behavior:'smooth'})
    
    }
    componentDidMount() {
        this.handleScroll()
  }
    render() {
        return (
            <div className="sheet">
                <h1 id="p3title" className="bold center">Plan for the day</h1>
                <div id="page3" className='left container_for_medium_margin'>
                    <p>
                        For every peer mentoring session we will have a plan for today. I can read it out loud to you or would you prefer to read it to yourself?  <br/>
                        Today's plan is: 
                    </p>
                    <ol>
                        <li className="li">Icebreaker game</li>
                        <li className="li">Learning about coping strategies</li>
                        <li className="li">Picking a coping strategy</li>
                        <li className="li">Time for questions</li>
                        <li className="li">Reminders about mentoring</li>
                        <li className="li">Make a plan for practice</li>
                    </ol>
                </div>
            </div>
        )
    }
}
export default Page3;
